import React from "react";
import NavBar from "../components/NavBar";
import Footer from "./html/footer/footer/Footer";

export default function Home() {
  return (
    <>
      <NavBar />
      <h1 className="text-light">Salut</h1>
      <Footer />
    </>
  );
}
